import React from 'react';
import '../styles/MedicalRecordCard.css';

const MedicalRecords = ({ record }) => {
    return (
        <div className="record-card">
            <h3>{record.date}</h3>
            <p>{record.details}</p>
            <button>Share Record</button>
        </div>
    );
};

export default MedicalRecords;
